import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        justifyContent: 'space-between',
        margin:'10px 0px'
    },
    field: {
        background: "#ffffff",
        margin: "auto 0",
        marginTop: '10px',
        width: "47%",
        borderRadius: "5px",
        "& .MuiInputLabel-root": {
            fontSize: "12px",
            textAlign: "center",
            fontFamily: 'inherit',
            lineHeight: '0'
        },
        "& input": {
            height: "fit-content",
            padding: '10px 0',
            margin: 'auto 10px',
            color: '#7A7A7A',
            fontSize: "12px",
            fontFamily: 'inherit',
            textAlign: "left",
            "&::placeholder": {
                color: "#7A7A7A",
                margin: 'auto 0',
                fontSize: "12px",
                opacity: 1,
            },
        },
    },
}));

export default function BottomFields() {
    const classes = useStyles();

    return (
        <div>
        <div className={classes.root}>
            <TextField className={classes.field} id="outlined-basic" label="Name" variant="outlined" />
            <TextField className={classes.field} id="outlined-basic" label="Email" variant="outlined" />
        </div>
        <div className={classes.root}>

        </div>
        </div>

    );
}
